INSERT INTO `articles` VALUES (1,'DEDICATED SPACE','1-dd-9.jpg','When working in an office, you are free to walk away from your desk and head home to enjoy the evening with your family or out with friends. Working from home makes it difficult to walk away when a task isn’t finished.','2020-10-15 21:04:55','2020-11-30 19:39:07',6,12,'Work and personal life balance','<p><span style=\"color: rgb(46, 46, 46); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">This is why having a dedicated work-space may align you with an office mindset. It will help you set boundaries, to encourage you to walk away when your day is over and come back with a fresh mind the next day.</span><br></p>','Working from home can make your work and personal life balance difficult, but this is less so when you have a dedicated workspace to walk away from once you’ve completed your workday.'),(2,'THE IMPORTANCE OF HAVING A DEDICATED WORKSPACE','2-dd-11.jpg','With high-speed WiFi and global connectivity, we can’t deny the fact that these days you can work from anywhere: your bedroom, living room, kitchen countertop, garden and all of the comfortable spaces you can think of around your home.','2020-10-15 21:06:08','2020-11-30 19:36:18',1,12,'Having a space dedicated for work','<p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px; padding: 0px; color: rgb(46, 46, 46); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Having a dedicated space for work will help you focus and avoid distraction, which can come from all sides; from the people you live with to yourself and your mind! As much as you don’t want to think about other things, sometimes the space you’re in can encourage your mind to drift. For instance, if you are working from your living room, you might find yourself thinking about the film you watched the previous night because you’re sitting exactly where this activity took place. This means only a part of your attention is dedicated to your work, contributing towards a counter productive workday. Having a dedicated workspace will help you focus your attention on the important work-related tasks, so you can walk out of your workspace at the end of the day and look forward to spending time enjoying your evening, perhaps with another movie!</p>','Social media'),(3,'EVERYTHING YOU NEED TO KNOW ABOUT COWORKING SPACES','3-hd-9.jpg','Walk into a coworking space and you’ll immediately notice that it feels different from a regular office. The smell of fresh coffee in the air is second only to the electric atmosphere that the energetic and excited occupants bring to the space. You’ll see a mix of those in deep focus at private desks and others striking up engaging conversations at large shared tables.  This is the culture of the coworking space.','2020-11-16 06:58:19','2020-11-30 19:33:06',1,11,'WHAT ARE COWORKING SPACES?','<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(35, 35, 35); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 16px; letter-spacing: 0.48px;\">In addition to culture, cost is another big draw. One of the advantages of these spaces is the ability to rent out only what you need vs an entire private office space, which can be costly. Through various membership based models,&nbsp;costs vary and allow for flexibility. These include options for daily fees or monthly fees. Membership costs also differ based on whether you use a shared desk or want a dedicated one.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(35, 35, 35); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 16px; letter-spacing: 0.48px;\">If you want to learn more, and be extremely inspired at the same time, the video below from space provider, NomadWorks, is useful. It brilliantly sums up the essence of coworking spaces.</p>','EVERYTHING YOU NEED TO KNOW ABOUT COWORKING SPACES View Larger Image With all the buzz around coworking spaces, we decided to provide you with a primer. We cover the coworking basics as well as implications for the traditional office and facility managers.'),(4,'DEDICATED DESK COWORKING','4-dd-4.jpg','Coworking may be on the rise, but it’s still a pretty new idea around Charlotte. Many independent professionals understand the gist of coworking (a shared office space) but voice confusion or concern over the details.','2020-11-16 07:42:00','2020-11-30 19:27:19',4,12,'Here\'s What Happens When You Take Away Dedicated Desks for Employees','<div class=\"standardText\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; scroll-behavior: smooth; margin-bottom: 25px; color: rgb(71, 71, 71); font-family: le-monde-livre-std, serif; font-size: 20px;\"><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; scroll-behavior: smooth; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; line-height: 2;\">The concept is based on data that says as much as 40% of an office\'s dedicated desk space sits unused on a given day. Employees are on vacation, work a flex schedule, or are stuck in back-to-back meetings.</p></div><div class=\"standardText\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; scroll-behavior: smooth; margin-bottom: 25px; color: rgb(71, 71, 71); font-family: le-monde-livre-std, serif; font-size: 20px;\"><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; scroll-behavior: smooth; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; line-height: 2;\">With their desk sitting idle, is it an efficient use of space and design?</p></div><div id=\"native_mid_article_inject\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; scroll-behavior: smooth; margin-bottom: 25px; color: rgb(71, 71, 71); font-family: le-monde-livre-std, serif; font-size: 20px;\"><div class=\"adElement AdContainer__adContainer__3lfQm \" id=\"native_mid_article_inject\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; scroll-behavior: smooth; position: relative; border: 0px; margin: auto; text-align: center; background: rgb(242, 242, 242); color: rgb(255, 255, 255); z-index: 4;\"></div></div><div class=\"standardText\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; scroll-behavior: smooth; margin-bottom: 25px; color: rgb(71, 71, 71); font-family: le-monde-livre-std, serif; font-size: 20px;\"><p style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; scroll-behavior: smooth; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; line-height: 2;\">Some think not, and many offices have adopted hotdesking as an alternative.</p></div><div id=\"oop_article_inject\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; scroll-behavior: smooth; margin-bottom: 25px; color: rgb(71, 71, 71); font-family: le-monde-livre-std, serif; font-size: 20px;\"><div class=\"adElement AdContainer__oop__3pT6u AdContainer__oop__3pT6u\" id=\"oop\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; scroll-behavior: smooth; position: relative; border: 0px; margin: auto; text-align: center; z-index: 10; height: 0px; background: none !important;\"></div></div><div class=\"standardText\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; scroll-behavior: smooth; margin-bottom: 25px; color: rgb(71, 71, 71); font-family: le-monde-livre-std, serif; font-size: 20px;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline-style: initial; outline-width: 0px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 30px; font-family: LW; color: rgb(0, 0, 0) !important;\">If you are coming from a traditional office environment, or have been working from home, it’s understandable that you would be wary. After all, coworking is a unique culture, with its own customs and structures. Many professionals, used to the safety of a cubicle and the structure of a 9-5, worry about being thrown into a chaotic environment with the same scarce resources (i.e. electrical outlets) of a crowded Starbucks. Have no fear, though: this is myth.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline-style: initial; outline-width: 0px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 30px; font-family: LW; color: rgb(0, 0, 0) !important;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline-style: initial; outline-width: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent;\">Coworking spaces are generally organized, productive, and very well equipped with professional resources and amenities. In addition, most coworking spaces in Charlotte have a few different options in terms of membership. A floating, or “hot desk” membership usually includes use of the collaborative space and amenities like the printer and coffee, but requires you to settle into whatever open space you can find.</span></p></div>','A dedicated desk membership is exactly that: a desk in a coworking space that is yours. No one else will use it while you’re gone, and you’ll always know there’s a spot waiting for you when it’s time to work. Usually, dedicated desks in a coworking space are designated to one area, so they are not interspersed with collaborative or social areas where you might be distracted.'),(5,'THE BENEFITS OF HOT DESKS','5-dd-15.jpg','As we\'ve mentioned, hot desking is simply the use of non-allocated workstations, meaning no employee has a fixed workstation. Rather, work spaces can be used by any employee, from any department or level, on any given day.','2020-11-30 19:42:25','2020-11-30 19:42:25',4,11,'What is hot desking?','<p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; font-size: 18px; line-height: 28px; color: rgb(50, 50, 50); font-family: Barlow, Arial, Tahoma, Helvetica, sans-serif;\">Before we get into the benefits, we should probably note that&nbsp;hot desking is not encouraged during the&nbsp;coronavirus pandemic. Although lockdown restrictions have already started to ease and some workers are beginning to return to the office, the majority of workplaces will be maintaining&nbsp;social distancing measures and avoiding hot desking for the foreseeable future.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; font-size: 18px; line-height: 28px; color: rgb(50, 50, 50); font-family: Barlow, Arial, Tahoma, Helvetica, sans-serif;\">On 11 May, the Department for Business, Energy and Industrial Strategy published guidence for employers which warned that they have a responsibility to protect their employees\' health. The guidance states that employers&nbsp;should keep office windows open,&nbsp;discourage potentially dangerous activities such as face-to-face meetings and avoid the use of hot desking.&nbsp;</p>','Many workers are now adopting this new approach, but what makes it so attractive?'),(6,'Stepping into the Meeting Room','6-mm-2.jpg','You\'re in a meeting room, getting ready for a conference call with co-workers on the other side of the globe. In no time flat you see them pop up on the projector and you start sharing your screen to show them your latest presentation. Or, you\'re in a cooking class and the teacher is cutting up ingredients.','2020-11-30 19:51:05','2020-11-30 19:51:05',6,14,'Stepping into the Meeting Room, and Classroom, of the Future','<p><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; font-size: 13px;\">The&nbsp;</span><span style=\"font-weight: 700; color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; font-size: 13px;\">meeting room</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; font-size: 13px;\">&nbsp;also has long curtains able to provide privacy when needed. IsIs office. View in gallery. When envisioning their office in Melbourne, IsIs wanted this space to reflect their values and character. As a result, design firm Kannfinch illustrated all these details using diverse methods. For instance, the transparent&nbsp;</span><span style=\"font-weight: 700; color: rgb(118, 118, 118); font-family: Roboto, Helvetica, sans-serif; font-size: 13px;\">meeting rooms</span><span style=\"color: rgb(102, 102, 102); font-family: Roboto, Helvetica, sans-serif; font-size: 13px;\">&nbsp;reflect the company’s transparency in business.</span><br></p>','The \'future\' of meeting room and classroom technology is always around the corner as users demand faster and higher quality video and audio with support for various devices and connectors.'),(7,'Video Conferencing Equipment for Any Meeting Room','7-mm-8.jpg','Video conferencing is increasingly penetrating our daily workflow, moving beyond meeting rooms and invading workplaces and mobile devices. The shift has become possible thanks to ever-increasing transition from pure hardware room systems (e.g. Polycom, Cisco, LifeSize) to software and hardware-software solutions.','2020-11-30 19:54:07','2020-11-30 19:54:07',1,14,'Video Conferencing Equipment for Any Meeting Room','<p><span style=\"color: rgba(0, 0, 0, 0.71); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">So how do you build the perfect meeting space where everyone can be seen and heard? This article describes how to fit meeting rooms of different sizes with video conferencing equipment, illustrated by specific examples. To find the best piece of AV equipment for your conference room or receive a free recommendation, please&nbsp;</span><a href=\"mailto:sales@trueconf.com\" style=\"box-sizing: inherit; color: rgb(0, 151, 167); text-decoration-line: underline; background-color: rgb(255, 255, 255); margin: 0px; padding: 0px; border: none; -webkit-tap-highlight-color: transparent; cursor: pointer; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">contact us</a><span style=\"color: rgba(0, 0, 0, 0.71); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">, we are happy to help.</span><br></p>','Software video conferencing solutions provide the same functionality at a more affordable price.'),(8,'Benefit From a Virtual Office','8-vo-10.png','The term \"virtual office\" might have sounded strange a few years ago, but today the concept is fairly standard. A company may not have a fixed address but still function as a provider of goods and services. Because of the rise of telecommuting and remote working, there\'s less need for a business to operate from a traditional brick-and-mortar location.','2020-11-30 19:56:09','2020-11-30 19:56:09',4,15,'5 Ways Your Business Can Benefit From a Virtual Office','<p><span style=\"color: rgb(33, 33, 33); font-family: &quot;PT Serif&quot;, TimesNewRoman, &quot;Times New Roman&quot;, Times, Georgia, serif; font-size: 19px;\">Startup businesses&nbsp;especially&nbsp;stand to benefit&nbsp;from&nbsp;the flexibility of&nbsp;virtual office spaces.&nbsp;Many startups are&nbsp;operating on shoestring budgets and&nbsp;don\'t have the funds for a professional corporate set up, complete with a secretary and meeting room. Virtual offices give&nbsp;them a chance to maintain a professional atmosphere&nbsp;while remaining within&nbsp;budget. In this article, we\'ll look at a few ways that a virtual office can benefit any business, not just&nbsp;startups.</span><br></p>','Thanks to the rise in remote working, virtual office spaces are more viable than ever.'),(9,'The Definitive Workspace: The Modernization Of The Private Office','9-pd-5.jpg','The way employees work is evolving, and the traditional office space just doesn’t cut it anymore. In fact, employee engagement experts at Dynamic Signal aggregated worldwide productivity reports in the workplace and found that 57% of stressed employees felt less productive and indifferent.','2020-11-30 19:59:15','2020-11-30 19:59:15',6,NULL,'Understanding The Private Office','<p><span style=\"color: rgb(33, 37, 41); font-family: PROXIMANOVA-REGULAR, Arial, Helvetica, sans-serif; font-size: 16px;\">As a result, coworking spaces became a popular alternative to exclusive offices, presenting figures that show the effectiveness of this platform (more than</span><span style=\"color: rgb(33, 37, 41); font-family: PROXIMANOVA-REGULAR, Arial, Helvetica, sans-serif; font-size: 16px;\"> </span><a href=\"https://www.business.com/articles/coworking-74-of-coworkers-are-more-productive/\" style=\"color: rgb(249, 157, 58); background-color: rgb(255, 255, 255); font-family: PROXIMANOVA-REGULAR, Arial, Helvetica, sans-serif; font-size: 16px;\">70% of coworkers were more productive</a><span style=\"color: rgb(33, 37, 41); font-family: PROXIMANOVA-REGULAR, Arial, Helvetica, sans-serif; font-size: 16px;\"> </span><span style=\"color: rgb(33, 37, 41); font-family: PROXIMANOVA-REGULAR, Arial, Helvetica, sans-serif; font-size: 16px;\">and engaged in their work). Given this data, private offices should be a thing of the past, but they’re still here because of radical changes, and now it looks like they’re here to stay.</span><br></p>','For a long time, employers have relied on the efficacy of the traditional office setting to cultivate their business. But equally important in improving the company are the employees, and private offices should be open to changes.'),(10,'Understanding The Private Office','10-po-4.jpg','Contemporary art, comfortable seats, and evocative colors are the name of the game inside coworking spaces.','2020-11-30 20:00:28','2020-11-30 20:00:28',6,13,'Workspace Evolution','<p style=\"color: rgb(33, 37, 41); font-family: PROXIMANOVA-REGULAR, Arial, Helvetica, sans-serif; font-size: 16px;\">Another point of contention between private offices and coworking spaces are the rental rates. Coworking spaces largely offer flexible rates that adapt according to the needs of the client. Private offices, on the other hand, primarily deal in fixed rates.</p><p style=\"color: rgb(33, 37, 41); font-family: PROXIMANOVA-REGULAR, Arial, Helvetica, sans-serif; font-size: 16px;\">Recently, however,&nbsp;<a href=\"https://kmc.solutions/\" style=\"color: rgb(249, 157, 58);\">private office space providers</a>&nbsp;have started to offer competitive and flexible rates on their offices as well. Depending on increasing or reducing employee count, business owners can choose to rent out a larger private space or a smaller one.</p>','What made coworking spaces or flexible workspaces so popular is that they’re structured differently than the private space.'),(11,'Training isn’t just important to any company, it is vital.','11-tr-2.jpg','Training presents a prime opportunity to expand the knowledge base of all employees, but many employers in the current climate find development opportunities expensive. Employees attending training sessions also miss out on work time which may delay the completion of projects. However despite these potential drawbacks, training and development provides both the individual and organisations as a whole with benefits that make the cost and time a worthwhile investment. The return on investment from training and development of employees is really a no brainer.','2020-11-30 20:05:43','2020-11-30 20:05:43',6,17,'But what does training and development,  mean to your organisation?','<p><span style=\"color: rgb(30, 41, 69); font-family: futura-pt, sans-serif; font-size: 22px;\">the investment in training that a company makes shows employees that they are valued. The training creates a supportive workplace. Employees may gain access to training they wouldn’t have otherwise known about or sought out themselves. Employees who feel appreciated and challenged through training opportunities may feel more satisfaction toward their jobs.</span><br style=\"color: rgb(30, 41, 69); font-family: futura-pt, sans-serif; font-size: 22px;\"></p>','Although there are many categories of training such as management training and or sales training, employees with Project Management skills are an important asset to any organisation.'),(12,'The Importance of Training and Development in the Workplace','12-tr-11.jpg','the employee who receives the necessary training is more able to perform in their job. The training will give the employee a greater understanding of their responsibilities within their role, and in turn build their confidence. This confidence will enhance their overall performance and this can only benefit the company. Employees who are competent and on top of changing industry standards help your company hold a position as a leader and strong competitor within the industry.','2020-11-30 20:05:44','2021-02-12 12:04:25',1,17,'So what are the benefits?','<p><span style=\"color: rgb(30, 41, 69); font-family: futura-pt, sans-serif; font-size: 22px;\"> Most employees will have some weaknesses in their workplace skills. A training program allows you to strengthen those skills that each employee needs to improve. A development program brings all employees to a higher level so they all have similar skills and knowledge. This helps reduce any weak links within the company who rely heavily on others to complete basic work tasks. Providing the necessary training creates an overall knowledgeable staff with employees who can take over for one another as needed, work on teams or work independently without constant help and supervision from others.</span><br></p>','Although there are many categories of training such as management training and or sales training, employees with Project Management skills are an important asset to any organisation.'),(13,'What is Coworking?','13-4b5fd1c5aa7b802a2af2fa11a7bbf38e8e933ece.jpg','Coworking is not just about the sharing of infrastructure and cost, it is about belonging to a community, accessibility, and sustainability. Coworking is the new way of working and sharing. Coworking spaces are designed to provide a productive and collaborative environment for their dynamic inhabitants and created without corporate constraints on what is perceived to be an “office” environment offering flexible memberships to suit most needs.','2021-02-25 07:12:53','2021-02-25 07:13:10',1,11,'What is Coworking?','<p style=\"margin-right: 0px; margin-bottom: 1.6em; margin-left: 0px; overflow-wrap: break-word; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 1.7em; font-family: Roboto, Helvetica, Arial, Lucida, sans-serif; vertical-align: baseline; word-break: break-word; color: rgba(0, 0, 0, 0.5);\">Coworking is not just about the sharing of infrastructure and cost, it is about belonging to a community, accessibility and sustainability. Coworking is the new way of working and sharing. Coworking spaces are designed to provide a productive and collaborative environment for their dynamic inhabitants and created without corporate constraints on what is perceived to be an “office” environment offering flexible memberships to suit most needs.</p><div><br></div>','Coworking is not just about the sharing of infrastructure and cost, it is about belonging to a community, accessibility and sustainability');
