rk and deep database which helps you choose the right workspace.\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Why Card One Heading Caption\"},\"why_card_two_heading_caption\":{\"value\":\"No Brokerage, No Service charges and No overhead costs. All our offerings are completely free.\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Why Card Two Heading Caption\"},\"why_card_three_heading_caption\":{\"value\":\"Pay only for what you use. Pick your Coworking desk, private desk, meeting rooms, training rooms for short and long term.\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Why Card Three Heading Caption\"},\"why_card_four_heading_caption\":{\"value\":\"Our market experts will help you in getting deep discounts upto 25% on the market prices.\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Why Card Four Heading Caption\"}}','2020-11-08 23:51:39','2021-02-24 09:46:57',NULL,'general','Active'),(39,'How It Works','how-it-works-settings','how-it-works-settings','How It Works','{\"background_image_heading\":{\"value\":\"How It Works\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Background Image Heading\"},\"background_image\":{\"value\":\"GBr0jTg1lt7XIRE.jpg\",\"type\":\"file\",\"extra\":\"\",\"tool_tip\":\"Background Image\"},\"our_expertise_heading\":{\"value\":\"Our Expertise\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Our Expertise\"},\"seeker_card_one_heading\":{\"value\":\"Discover\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card One Heading\"},\"seeker_card_two_heading\":{\"value\":\"Shortlist and Compare\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Two Heading\"},\"seeker_card_three_heading\":{\"value\":\"Enquire and Schedule a visit\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Three Heading\"},\"seeker_card_four_heading\":{\"value\":\"Pick your preferred venue\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Four Heading\"},\"seeker_card_one_heading_caption\":{\"value\":\"Search from 3000+ unique spaces\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card One Heading Caption\"},\"seeker_card_two_heading_caption\":{\"value\":\"Review venues and compare their wide offerings\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Two Heading Caption\"},\"seeker_card_three_heading_caption\":{\"value\":\"Enquire your idle workspace and visit the venue at your convenient time.\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Three Heading Caption\"},\"seeker_card_four_heading_caption\":{\"value\":\"Review and negotiate offers. Finalise the contract and move in.\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Four Heading Caption\"},\"owner_card_one_heading\":{\"value\":\"List your space\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card One Heading\"},\"owner_card_two_heading\":{\"value\":\"Manage your leads\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Two Heading\"},\"owner_card_three_heading\":{\"value\":\"Offer a deal and Close\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Three Heading\"},\"owner_card_one_heading_caption\":{\"value\":\"Fill in online form and create your profile in real time. Showcase your offerings and set your terms.\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card One Heading Caption\"},\"owner_card_two_heading_caption\":{\"value\":\"Companies who like your space will connect you through worklease. Invite them for a walkthrough of your space.\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Two Heading Caption\"},\"owner_card_three_heading_caption\":{\"value\":\"If you have found the right match, offer them a deal in detail and finalise the contract.\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Three Heading Caption\"}}','2020-11-09 00:03:41','2021-01-05 13:39:52',NULL,'general','Active'),(40,'Landlords','landlord-settings','landlord-settings','Land Lord Settings','{\"background_image_heading\":{\"value\":\"Flexible Landlord Solutions\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Background Image Heading\"},\"background_image\":{\"value\":\"Ra0XBnPtKaht6bi.jpg\",\"type\":\"file\",\"extra\":\"\",\"tool_tip\":\"Background Image\"},\"content_heading\":{\"value\":\"Why Premier?\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"About Us Content Heading\"},\"content\":{\"value\":\"Are you looking for a fully managed and serviced office space with flexible terms? Do not worry, we got your back. If you feel that it is impossible to uncover good things, consider work lease your front line in a world full of options. The work lease marketplace provides a platform that helps entrepreneurs, startups, and companies find the workspace that best fits their requirements.\\r\\n\\r\\nA managed office is similar to a serviced office, in that both provide flexible space that is operated by a separate party. However, the key difference with this type of office is that a managed office requires greater input from the tenant, with space itself a blank canvas that needs to be filled. A tenant must define their exact requirements, from the number of desks, chairs, and meeting rooms to floor finishes, so that the provider can deliver exactly what is needed \\u2013 effectively making a managed office a custom-built workspace. A tenant is normally required to commit to a term of 12 months but rather than pay per desk, a tenant pays for the amount of space they occupy.\",\"type\":\"textarea\",\"extra\":\"\",\"tool_tip\":\"Content\"},\"content_image\":{\"value\":\"H4lJflcnjVYfLxb.jpg\",\"type\":\"file\",\"extra\":\"\",\"tool_tip\":\"About Us Content Image\"},\"content_one_main_heading\":{\"value\":\"Solutions Designed to Maximize Your Assets and Portfolio Capital\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Content One Heading\"},\"content_one_card_one_heading\":{\"value\":\"Management \\/ Joint Ventures & Partnerships\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card One Heading\"},\"content_one_card_two_heading\":{\"value\":\"Consulting\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Two Heading\"},\"content_one_card_one_heading_caption\":{\"value\":\"Our network with hosts across different markets will help you find workspace for all your requirements.\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card One Heading Caption\"},\"content_one_card_two_heading_caption\":{\"value\":\"Our network with hosts across different markets will help you find workspace for all your requirements.\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Card Two Heading Caption\"},\"contact\":{\"value\":\"Are your looking for a fully managed and serviced office space with flexible terms? Do not worry, we got your back. If you feel that it is impossible to uncover good things, consider work lease your front line in world full of options. The worklease market place provides a platform that helps entrepreneurs, startups and companies find the workspace that best fits their requirements.\\r\\n\\r\\nA serviced office, as with serviced apartments, is a workspace that can be rented on a flexible, short-term basis and offers inbuilt facilities such as clerical support, reception staff and WiFi. A tenant pays an all-in cost per desk each month and will typically sign for a term of 1-12 months. The office space is fitted out and designed to the specification of the provider, enabling a tenant to simply turn up and start working.\\r\\n\\r\\n\\r\\n\\r\\nA managed office is similar to a serviced office, in that both provide flexible space that is operated by a separate party. However, the key difference with this type of office is that a managed office requires greater input from the tenant, with the space itself a blank canvas that needs to be filled. A tenant must define their exact requirements, from the number of desks, chairs and meeting rooms to floor finishes, so that the provider can deliver exactly what is needed \\u2013 effectively making a managed office a custom-built workspace. A tenant is normally required to commit to term of 12 months but rather than pay per desk, a tenant pays for the amount of space they occupy.\",\"type\":\"textarea\",\"extra\":\"\",\"tool_tip\":\"Contact\"},\"contact_heading\":{\"value\":\"Contact Michael Pollack\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Contact Heading\"},\"contact_image\":{\"value\":\"9Q3y2To6AuKXMS3.jpg\",\"type\":\"file\",\"extra\":\"\",\"tool_tip\":\"Contact Image\"}}','2020-11-09 00:20:39','2021-02-25 06:51:05',NULL,'general','Active'),(41,'Google Api Key','google-api-key-settings','google-api-key-settings','Google Maps Api Key','{\"google_api_key\":{\"value\":\"AIzaSyB8e3Swr26cXgIydGPQ3zC3DpSHhkADckg\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Google Api Key\"}}','2020-11-09 05:41:24','2020-11-23 08:10:47',NULL,'general','Active'),(42,'Our Workspaces','our-workspaces-settings','our-workspaces-settings','Our WorkSpaces Settings','{\"home_hero_bgimage\":{\"value\":\"B2msVkgKUYDTepm.jpg\",\"type\":\"file\",\"extra\":\"\",\"tool_tip\":\"Home Hero Backgroung Image\"},\"home_hero_bgimagecontainer\":{\"value\":\"8gnp09mDY41QGU8.jpg\",\"type\":\"file\",\"extra\":\"\",\"tool_tip\":\"Container Backgroung Image\"}}','2020-11-11 02:43:05','2020-12-21 08:05:18',NULL,'general','Active'),(43,'Post Requirement','post-requirement-settings','post-requirement-settings','Post Requirement Settings','{\"facebook_link\":{\"value\":\"https:\\/\\/www.facebook.com\\/digisamaritan\\/\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Facebook Link\"},\"twitter_link\":{\"value\":\"https:\\/\\/twitter.com\\/samaritandigi\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Twitter Link\"}}','2020-11-11 02:43:05','2021-02-25 06:56:05',NULL,'general','Active');
