(11,  'Hot Desks',  '11-coworking.jpg', 'Having its roots in the open office plans, this is a flexible-office practice as part of coworking space where places are not assigned to anyone. A pool of seats is allotted to the group and they are free to occupy and the seat of their choice.', 'Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s',  'Hot desking is often found in workplaces with flexible schedules for employees, where not all employees are actually working in an office at the same time or on the same schedules.', 'when an unknown printer took a galley of type and scrambled it to make a type specimen book',  '2020-07-17 04:51:51',  '2020-11-30 06:49:55',  'hot-desks',  1,  NULL, NULL),
(12,  'Dedicated Desks',  '12-5-1.jpg', 'For entrepreneurs that want to be a part of a coworking community without necessarily being out in the open, and who don’t want to leave their desk rental to chance, they might find that renting a dedicated desk is their best option.',  'Generate Lorem Ipsum placeholder text for use in your graphic, print and web layouts, and discover plugins for your favorite writing, design and blogging tools.', 'Dummy text is text that is used in the publishing industry or by web designers to occupy the space which will later be filled with \'real\' content.', 'Lorem Ipsum dummy text based on artificial languages', '2020-07-17 04:55:30',  '2020-11-30 06:42:42',  'dedicated-desks',  1,  NULL, NULL),
(13,  'Private Desk', '13-8-1.jpg', 'Though it can seem a little odd to desire a private office amid a coworking space, it’s actually become quite popular. You get all the benefits of coworking, such as networking, community and still having a private area to take client meetings.', 'The point of using Lorem Ipsum', 'Many desktop publishing packages', 'There are many variations of passages of Lorem Ipsum available', '2020-07-17 04:57:26',  '2020-11-30 06:46:31',  'private-desk', 1,  NULL, NULL),
(14,  'Meeting Rooms',  '14-meeting.jpg', '“Meeting rooms,” meanwhile, are often as small as a room that can only fit few people. Moreover, these smaller rooms in many cases lack tables and are furnished only by chairs (and potentially some display items like a whiteboard or a projector).', 'Excepteur sint occaecat cupidatat non proident.Excepteur sint occaecat cupidatat non proident.', 'Ut enim ad minim veniam',  'Excepteur sint occaecat cupidatat non proident', '2020-07-17 04:59:54',  '2020-11-30 06:54:01',  'meeting-rooms',  2,  NULL, NULL),
(15,  'Virtual Office', '15-virtual.jpg', 'As more people find ways to work remotely, the benefits of a virtual office are immediately noticeable. However, not everything is as easy as it seems. Some may find scheduling of virtual office space no different than the time-consuming scheduling.',  'charms of pleasure of the moment.',  'so blinded by desire, that they cannot foresee the pain and trouble',  'These cases are perfectly simple and easy to distinguish', '2020-07-17 05:04:43',  '2020-11-30 06:57:55',  'virtual-office', 3,  NULL, NULL),
(16,  'Private Office', '16-7-1-thmb.jpg',  'Private office is small rooms or cabinets which are separated from the open office by partitions. They are usually meant for top executives like Managing Director, Secretary, General Manager, Sales Department Manager and the like.', 'But I must explain to you how all this mistaken idea of denouncing.',  '\"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.',  'ed ut perspiciatis unde omnis iste natus error sit voluptatem',  '2020-07-17 05:08:18',  '2020-11-30 06:58:59',  'private-office', 4,  NULL, NULL),
(17,  'Training Room',  '17-training.jpg',  'A seminar is a meeting in which others are trained or educated in a particular topic. A training seminar room is where the group meets to carry out their training or education. While seminars are often referred to in academic terms, businesses.', 'ut aut reiciendis voluptatibus maiores alias consequatur aut', 'These cases are perfectly simple and easy to distinguish', 'Itaque earum rerum hic tenetur a sapiente delectus, ut aut reiciendis voluptatibus maiores alias', '2020-07-17 05:12:22',  '2020-11-30 06:56:06',  'training-room',  5,  NULL, NULL);
