INSERT INTO `testimonials` VALUES (2,'4 thumbs way up for The Coworking Space!','2-testmony.jpg','4-thumbs-way-up-for-the-coworking-space','<p><span style=\"color: rgb(68, 68, 68); font-family: proxima-nova; font-size: 15px; letter-spacing: 0.3px; text-align: center;\">\"I was skeptical at first, but man was I pleasantly surprised! I was so used to the traditional world of work, I\'d never thought about co-working. I\'ve been an editor for fifteen years. This place introduced me to completely new possibilities. I have met people from all different walks of life and diverse industries. I\'m so thrilled to be part of this co-working community!\" </span><br></p>','2020-10-15 21:08:34','2021-02-24 12:35:11'),(3,'Unforgettable experience.','3-mm-6.jpg','unforgettable-experience','<p><span style=\"color: rgb(68, 68, 68); font-family: proxima-nova; font-size: 15px; letter-spacing: 0.3px; text-align: center;\">\"It\'s such a joy to be able to step out of the classroom after work, and enter a space where I feel right at home. I visited The Coworking Spaceto brainstorm on ways to take my project to the next level. I needed a private space (dedicated desk) to work on my novel. It\'s great space to bring laptops and collaborate with other professionals.\"</span><br></p>','2020-11-16 11:55:37','2020-11-30 07:34:05'),(4,'Ideal for innovative!','4-pd-4.jpg','ideal-for-innovative','<p><span style=\"color: rgb(68, 68, 68); font-family: proxima-nova; font-size: 15px; letter-spacing: 0.3px; text-align: center;\">t\'s rare that you\'re able to find a space that is so welcoming of creatives and innovators. At The Office Hub, the sky is the limit. I have recently started facilitating business meetings here, while serving as a new member. It\'s a great place to foster community.\"</span><br></p>','2020-11-16 12:09:59','2020-11-30 07:36:00'),(5,'Great location','5-hd-9.jpg','great-location','<p><span style=\"color: rgb(101, 101, 101); font-family: Lato, sans-serif; font-size: 16px;\">Great location and very courteous staff. I had to wait in the lobby on the ground floor and the security guard switched on the extra ac to keep me comfortable. In another instance, the receptionist helped us with food as well as other details to help our meeting for well. Good option for coworking space in Madhapur. They have very good infrastructure.</span><br></p>','2020-11-30 07:44:20','2020-11-30 07:48:36'),(6,'Professional service.','6-hd-4.png','professional-service','<p><span style=\"color: rgb(68, 68, 68); font-family: proxima-nova; font-size: 15px; letter-spacing: 0.3px; text-align: center;\">\"Stop by for a visit today, don\'t wait! Bring your friends and colleagues. Attentive staff, newly renovated space, chic design. I am always welcomed with a big smile when I enter The Coworking Space. Unparalleled service. 5 stars for this unique co-working space!</span><br></p>','2020-11-30 07:47:23','2020-11-30 07:48:19');
